import './App.css';
import { Button, Slider } from 'react-bootstrap';

function App() {
  return (
    <div >
      <header >
        <h1>Send a reminder to your future self</h1>
        <Button variant="outlined" color="error">
          Error
        </Button>
      </header>
      <Slider
        size="small"
        defaultValue={70}
        aria-label="Small"
        valueLabelDisplay="auto"
      />
      <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />

    </div>

  );
}

export default App;
